import { api } from "./Intercepter"


export default {
    getByStatus(status) {
        const theses = api.get(`status/${status}`);
        console.log(theses);
        return theses;
        
    
      },
      getUserBook(id) {
        const books = api.get(`books/user-book/${id}`);
        return books;
    
      }  }
